import './App.css';
import React, { useState, useEffect } from 'react';

const App = () => {
  const [data, setData] = useState(null);

  const url = "http://api.weatherapi.com/v1/current.json?key=e77503e6c87a4abf9eb203542242908&q=Riverside";
  useEffect(() => {
    fetch(url)
    .then(response => response.json())
    .then(json => setData(json))
    .catch(errors => console.error(errors))
  }, []);

  return (
    <div>
      {data? <p>Current temp: <pre>{data.current.temp_f}</pre></p>: <p>Oops something went wrong!</p>}
    </div>
  );
}

export default App;
